content=Life was a fly that faded, and death a drone that stung; / The world was very old indeed when you and I were young. / They twisted even decent sin to shapes not to be named: / Men were ashamed of honour; but we were not ashamed. / Weak if we were and foolish, not thus we failed, not thus; / When that black Baal blocked the heavens he had no hymns from us

